INSERT INTO Frame (ID, Name, Definition, CreatedBy) VALUES (425, 'Predicting', '<def-root>A <fen>Speaker</fen> states or makes known a future <fen>Eventuality</fen> on the basis of some <fen>Evidence</fen>. <ex> <fex name="Speaker">The Weather Centre</fex> <t>predicted</t>  <fex name="Eventuality">that it would be warmer but wet for the weekend</fex>.</ex> <ex> <fex name="Speaker">The OECD</fex> <t>forecast</t> <fex name="Eventuality">that UK interest rates would be 13 per cent by the end of 1989</fex>.</ex> <ex><fex name="Speaker">Another seer who</fex> <t>forecast</t> <fex name="Eventuality">a Tory majority</fex> -- without compromising his impartiality -- was Sir Robin Day .</ex> <ex><fex name="Eventuality">The European market</fex> is  <t>forecast</t> <fex name="Eventuality">to grow 18.1% by the end of next fiscal year</fex>.</ex></def-root>)', 'josef');
INSERT INTO Frame (ID, Name, Definition, CreatedDate, CreatedBy, ModifiedDate) VALUES (19, 'Awareness', '<def-root>The words in this frame have to do with the presence of some <fen>Content</fen> in the awareness, knowledge or beliefs of a <fen>Cognizer</fen>. \n\n<ex><fex name=\"Cognizer\">Your boss</fex> is <t>aware</t> <fex name=\"Content\">of your commitment</fex>.</ex></def-root>', '2001-02-07 16:11:51', '', '2003-01-06 17:30:50');
INSERT INTO Frame (ID, Name, Definition, SymbolicRep, Image, CreatedBy, CreatedDate, ModifiedDate) VALUES (1,'TestUp', 'The words in this frame take direct objects that denote entities in the world, and indicate awareness of those entities, without necessarily giving any information about the conten', NULL, NULL, 'test user', '2003-01-06 17:30:50', '2003-01-06 17:30:50' );
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (2,'Causation', '<def-root>A <fen>Cause</fen>, animate or inanimate, causes an <fen>Effect</fen>. Those frames that inherit the Causation frame convey the idea that some event is responsible for the occurrence of another event (or state).  In the  inheriting frame, typically an FE like Agent or Causer is proposed for an individual or force associated with the causing event, but ultimately we assume event causation.</def-root>', 'alice');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES  (6,'Communication', '<def-root>A <fen>Communicator</fen> conveys a <fen>Message</fen> to an <fen>Addressee</fen>; the <fen>Topic</fen> and <fen>Medium</fen> of the communication also may be expressed.  This frame includes no specification of the method of communication (speech, writing, gesture, etc.).  The frames that inherit the general Communication frame can add elaboration to the <fen>Medium</fen> in a variety of ways (<ment>in French, on the radio program, in a letter</ment>) or to the <fen>Manner</fen> of communication (<ment>babble, rant, shout, whisper</ment>). There are also frames that either do not inherit all of the FEs of this frame or do not inherit them in a straightforward manner (such as Conversation, in which <fen>Communicator</fen> and <fen>Addressee</fen> alternate roles, and are often expressed by a single, plural NP).</def-root>', 'alice');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES  (3,'Motion', '<def-root>Some entity (<fen>Theme</fen>) starts out in one place (<fen>Source</fen>) and ends up in some other place (<fen>Goal</fen>), having covered some space between the two (<fen>Path</fen>). The frames that inherit the general Motion frame add some elaboration to this simple idea.  Inheriting frames can add Goal-profiling (<ment>arrive, reach</ment>), Source-profiling (<ment>leave, depart</ment>), or Path-profiling (<ment>traverse, cross</ment>), or aspects of the manner of motion (<ment>run, jog</ment>) or assumptions about the shape-properties, etc., of any of the places involved (<ment>insert, extract</ment>). A particularly complex area in the vocabulary of Motion is the depiction of the relation of Vehicles to the Theme.  In some cases, no separate Theme is expressed: <ex>The plane <t>flew</t> over the city.</ex>  In this case, the sentence is annotated in Self-motion.  When the Vehicle is profiled as being operated by a Driver, the sentence is annotated in the Operate_vehicles frame: <ex>Don''t try to <t>fly</t> an F-16 without training!</ex> This is very similar to the Carrying frame which covers cases where the Vehicle is necessarily involved, but the movement of the <fen>Theme</fen> (something carried by the Vehicle) is profiled: <ex>It''s scary <t>flying</t> hundreds of people over thousands of miles of ocean every day.</ex> Some of the same vocabulary is also used to describe the situation where Passengers Ride_vehicles: <ex>I <t>flew</t> to Chicago on the red-eye.</ex> Finally, there are cases where, despite the use of similar vocabulary, there is no self-propelled Vehicle involved at all: <ex>The ball <t>flew</t> over the fence.</ex> This last type is annotated in the simple Motion frame.</def-root>', 'alice');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES  (4,'Perception', '<def-root>A <fen>Perceiver</fen> perceives a <fen>Phenomenon</fen>. The general Perception frame is an inherited background to all frames that have to do with some sentient being responding to changes in the environment, independently of the sensory modalities.  The inheriting frames may specify the modalities (<ment>see, hear, taste, smell</ment>), or may emphasize the experiences or acts of the perceiver (<ment>peek, eavesdrop</ment>), or the properties of the perceived phenomena (<ment>clank, rattle, thump</ment>).</def-root>', 'alice');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES  (5,'Reciprocality', '<def-root>This frame characterizes events performed reciprocally, with two equal participants acting on each other.  It is inherited, for example, by the Conversation frame in which two people are effectively both speakers and addressees in a joint act of communication. </def-root>', 'alice');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (7,'Certainty', '<def-root>This frame concerns a <fen>Cognizer</fen>''s certainty about the correctness of beliefs  or expectations. It only includes uses where a <fen>Cognizer</fen> is expressed. <ex><fex name="Cognizer">Lermontov</fex> <m>was</m> <t>certain</t> <fex name="Content">he would come to the party</fex>.</ex></def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (8,'Activity', '<def-root>This is an abstract frame for durative activities, in which the <fen>Entity</fen> enters an ongoing state of the <fen>Activity</fen>, remains in this state for some <fen>Duration</fen> of <fen>Time</fen>, and leaves this state either by finishing or by stopping.   The <fen>Entity</fen> may be more specifically realized as an <fen>Agent</fen> who performs an intentional <fen>Activity</fen>. This frame is intended mostly for the inheritance of common FEs, and to provide the frame structure for the beginning, ongoing, finish, or stop stage of an <fen>Activity</fen>, each of which constitutes a subframe of this frame. This frame should be compared to the Process frame.</def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (9,'Activity_finish', '<def-root>This frame contains adjectives and nouns that describe the truth or sincerity of communication. These words, analogously to behaver-evaluating words, can apply either to <fen>Speaker</fen>s or to the <fen>Message</fen>s they produce.', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (10,'Activity_start', '<def-root>Words in this frame have to do with a <fen>Cognizer</fen> creating a new intellectual entity, the <fen>Invention</fen>. These words are similar to words of physical creation such as <ment>build</ment> and <ment>make</ment>, ', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (11,'Activity_stop', '<def-root>These words describe the size of message that a <fen>Speaker</fen> is judged by a (usually unexpressed) <fen>Judge</fen> to give, either in a specific occasion or <fen>Topic</fen> or in general. As in other communication frames', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (12,'Activity_resume', '<def-root>The words in this frame describe the "fictive" motion of a stationary Road. Some of the targets cast the scene primarily in terms of the Path_shape: ', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (13,'Activity_pause', '<def-root>These are words describing situations in which a <fen>Perpetrator</fen> takes something (<fen>Goods</fen>) from a <fen>Victim</fen> that does not belong to him . The robbery can be done in a particular <fen>Manner</fen> ', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (14,'Activity_prepare', '<def-root>An <fen>Emitter</fen> emits a <fen>Beam</fen> of light from a <fen>Source</fen>, along a <fen>Path</fen>, and/or towards a <fen>Goal</fen>.  Essentially, this frame denotes the (semi-)fictive motion of the the <fen>Beam</fen>. ', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (15,'Reporting', '<def-root>In this frame an <fen>Informer</fen> informs the <fen>Authorities</fen> of the illegal or otherwise improper <fen>Behavior</fen> of the <fen>Wrongdoer</fen>. <ex> <fex name="Informer">Tony</fex> <t>reported</t> <fex name="Wrongdoer">Michael</fex> <fex name="Authorities">to the police</fex> <fex name="Behavior">for breaking into his car</fex> . </ex> <ex> <fex name="Informer">The teacher</fex> <t>reported</t> <fex name="Behavior">the bathroom vandalism</fex> . </ex></def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (16,'Statement', '<def-root>This frame contains verbs and nouns that communicate the act of a <fen>Speaker</fen> to address a <fen>Message</fen> to some <fen>Addressee</fen> using language.  A number of the words can be used performatively, such as <ment>declare</ment> and <ment>insist</ment>. <ex>I now <t>declare</t> you members of this Society.</ex> </def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (17,'Evidence', '<def-root>The <fen>Support</fen>, a phenomenon or fact,  lends support to a claim or proposed course of action, the <fen>Proposition</fen>, where the <fen>Domain_of_Relevance</fen> may also be expressed.  Some of the words in this frame (e.g. argue) are communication words used in a non-communicative, epistemic sense. </def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (18,'Judgement', '<def-root>A <fen>Cognizer</fen> makes a judgment about an <fen>Evaluee</fen>. The judgment may be positive (e.g. <ment>respect</ment>) or negative (e.g. <ment>condemn</ment>), and this information is recorded in the semantic types Positive and Negative on the Lexical Units of this frame. There may be a specific <fen>Reason</fen> for the <fen>Cognizer</fen>''s judgment, or there may be a capacity or <fen>Role</fen> in which the <fen>Evaluee</fen> is judged. <ex></ex> This frame is distinct from the Judgment_communication frame in that this frame does not involve the Cognizer communicating his or her judgment to an Addressee.   <ex>JUDGMENT:  She <t>admired</t> Einstein for his character.</ex> <ex>JUDGMENT_COMMUNICATION:  She <t>accused</t> Einstein of collusion.</ex> <ex></ex> Currently, however, some lexical units and annotation for both remain in this frame.</def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (20,'Arriving', '<def-root>An object <fen>Theme</fen> moves in the direction of a <fen>Goal</fen>. The <fen>Goal</fen> may be expressed or it may be understood from context, but its is always implied by the verb itself.</def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (21,'Self_motion', '<def-root>The <fen>Self_mover</fen>, a living being, moves under its own power in a directed fashion, i.e. along what could be described as a <fen>Path</fen>, with no separate vehicle.</def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (22,'Request', '<def-root>In this frame a <fen>Speaker</fen> asks an <fen>Addressee</fen> for something, or to carry out some action. <ex><fex name="Speaker">The customer</fex> <t>demanded</t> <fex name="Msg">a refund</fex>.</ex> <ex><fex name="Speaker">I</fex> <t>begged</t> <fex name="Addressee">my parents</fex> <fex name="Message">to let me stay up late.</fex></ex> </def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (23,'Statement', '<def-root>This frame contains verbs and nouns that communicate the act of a <fen>Speaker</fen> to address a <fen>Message</fen> to some <fen>Addressee</fen> using language.  A number of the words can be used performatively, such as <ment>declare</ment> and <ment>insist</ment>. <ex>I now <t>declare</t> you members of this Society.</ex> </def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (24,'Discussion', '<def-root>Two (or more) people (the <fen>Interlocutors</fen>, also encodable as <fen>Interlocutor_1</fen> and <fen>Interlocutor_2</fen>) talk to one another. No person is construed as only a speaker or only an addressee. Rather, it is understood that both (or all) participants do some speaking and some listening--the process is understood to be symmetrical or reciprocal.  This frame differs from the Chatting frame in that the <fen>Interlocutors</fen> have a particular question that they are attempting to decide or understand.</def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (25,'Gesture', '<def-root>The words in this frame have to do with non-verbal communication. Topic is not normally expressed with these words. This seems to be related to the absence of a verbal code in cases of gestural communication. Topic can be viewed as a partial characterization of a <fen>Message</fen>, but such partial characterization is either difficult or irrelevant in the absence of a verbal code. </def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (26,'Recovery', '<def-root>These words describe the recovery or healing of a <fen>Patient</fen> from an <fen>Affliction</fen> without reference to the influence of any Treatment or Healer (see the Cure frame). </def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (27,'Filling', '<def-root>These are words relating to filling containers and covering areas with some thing, things or substance, the <fen>Theme</fen>. The area or container can appear as the direct object with all these verbs, and is designated <fen>Goal</fen> because it is the goal of motion of the <fen>Theme</fen>. Corresponding to its nuclear argument status, it is also affected in some crucial way, unlike goals in other frames. <ex><fex name="Agent">Lionel Hutz</fex> <t>coated</t> <fex name="Goal">the wall</fex> <fex name="Theme">with paint</fex>. </ex></def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (28,'Placing', '<def-root>Generally without overall motion,  an <fen>Agent</fen> places a <fen>Theme</fen> at a location, the <fen>Goal</fen>, which is profiled.  In this frame, the <fen>Theme</fen> is under the control of the <fen>Agent</fen>/<fen>Cause</fen> at the time of its arrival at the <fen>Goal</fen>. <ex><fex name="Agent">David</fex> <t>placed</t> <fex name="Theme">his briefcase</fex> <fex name="Goal">on the floor</fex>.</ex></def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedBy) VALUES (29,'Telling', '<def-root>A <fen>Speaker</fen> addresses an <fen>Addressee</fen> with a <fen>Message</fen>, which may be indirectly referred to as a <fen>Topic</fen>.</def-root>', 'test user');
INSERT INTO Frame (ID,Name, Definition, CreatedDate,CreatedBy,ModifiedDate) VALUES (30,'Avoiding', '<def-root>An <fen>Agent</fen> avoids an <fen>Undesirable_situation</fen> under certain <fen>Conditions</fen>. That situation may be an activity (e.g. going to school), or an entity (perhaps) metonymic for such an activity or situation (e.g. the curb).  The situation may be undesirable from the <fen>Agent</fen>s point of view (e.g. <ment>evade</ment>), to someone else (e.g. <ment>forbear</ment>), or from the point of view of an external morality (e.g. <ment>abstain</ment>).</def-root>', '2002-02-25 14:06:49', '', '2004-06-28 12:19:15');
INSERT INTO Frame (ID,Name, Definition, CreatedDate, CreatedBy, Image, SymbolicRep, ModifiedDate) VALUES (31,'Trial', '<def-root>A trial is a process conducted in a <fen>Court</fen> before a <fen>Judge</fen> and (usually) a <fen>Jury</fen> in which the participants meet in order to decide a <fen>Case</fen>.  The <fen>Prosecution</fen> attempts to prove that the <fen>Defendant</fen> is guilty of the <fen>Charges</fen> and the <fen>Defense</fen> tries to prove that the <fen>Defendant</fen> is innocent.  Trials have a rich schematic structure which is only partially represented here.  The Trial frame is the part of the Criminal Process frame that occurs after a crime, Arrest of a suspect, Arraignment, jury selection, etc. and before Sentencing and Punishment or release.  The Trial is made up of court appearances.  The beginning of the Trial generally involves Opening Arguments, in which the <fen>Prosecution</fen> and the <fen>Defense</fen> present their respective points of view.  Then during the course of the Trial, both sides present evidence, some of which is provided by witnesses with testimony, and this is then drawn upon as support for their arguments.  Following the presentation of evidence, testimony, and arguments, generally culminating in Closing Arguments for each side, the <fen>Jury</fen> (if present) deliberates and either comes to no sufficient concensus or produces a Verdict.</def-root>', '2003-07-28 16:26:09', 'infinity', NULL, NULL, '2003-07-30 15:59:40');
INSERT INTO Frame (ID,Name, Definition, CreatedDate, CreatedBy, Image, SymbolicRep, ModifiedDate) VALUES (32,'Bringing', '<def-root>This frame concerns the movement of a <fen>Theme</fen> and an <fen>Agent</fen> and/or <fen>Carrier</fen>.   The <fen>Agent</fen>, a person or other sentient entity, controls the shared <fen>Path</fen> by moving the <fen>Theme</fen> during the motion. In other words, the <fen>Agent</fen> has overall motion in directing the motion of the <fen>Theme</fen>.  The <fen>Carrier</fen> may be a separate entity, or it may be the <fen>Agent</fen>s body. The <fen>Constant_location</fen> may be a subregion of the <fen>Agent</fen>s body or (a subregion of) a vehicle that the <fen>Agent</fen> uses.\n\n<ex><fex name=\"Agent\">Karl</fex> <t>carried</t> <fex name=\"Theme\">the books</fex> <fex name=\"Path\">across campus</fex> <fex name=\"Path_end\">to the library</fex> <fex name=\"CL\">on his head</fex>.</ex>\n<ex><fex name=\"Agent\">Karl</fex> <t>carried</t> <fex name=\"Theme\">the books</fex> <fex name=\"Path\">across campus</fex> <fex name=\"Path_end\">to the library</fex> <fex name=\"CL\">in his truck</fex>.</ex>\n<ex><fex name=\"Agent\">Karl</fex> <t>carried</t> <fex name=\"Theme\">the books</fex> <fex name=\"Path\">across campus</fex> <fex name=\"Path_end\">to the library</fex> <fex name=\"Carrier\">by truck</fex>.</ex>\n<ex><fex name=\"Carrier\">The truck</fex> <t>carried</t> <fex name=\"Theme\">the books</fex> <fex name=\"Path\">across campus</fex> <fex name=\"Path_end\">to the library</fex> <fex name=\"CL\">in specially designed boxes</fex>.</ex>\nThe  FEs include <fen>Path</fen>, <fen>Path_end</fen>, and <fen>Path_start</fen>.  <fen>Path_end</fen> is very similar to Goal, though the <fen>Path_end</fen> serves to describe the path by means of its end-point.  <fen>Area</fen> is an area that contains the motion when the path is understood as irregular.  \nThis frame empasizes the path of movement as opposed to the FEs Source or Goal as inFiilling or Placing. </def-root>', '2001-11-16 11:59:50', 'acwright', NULL, '', '2004-06-28 15:34:25');
INSERT INTO Frame (ID,Name, Definition, CreatedDate, CreatedBy, Image, SymbolicRep, ModifiedDate) VALUES (33,'Make_cognitive_connection', '<def-root>Using <fen>Evidence</fen>, which may or may not be expressed, a <fen>Cognizer</fen> recognizes or proves that <fen>Concept1</fen> is associated causally or collocationally with another concept, <fen>Concept2</fen>.  These may be expressed collectively as associated <fen>Concepts</fen>.\n\n</def-root>', '2001-12-15 22:31:06', 'infinity', NULL, '', '2003-07-01 16:12:04');
INSERT INTO Frame (ID, Name, Definition, CreatedDate, CreatedBy, ModifiedDate)VALUES (1019, 'Religious_belief', '<def-root>A <fen>Believer</fen> has faith in a piece of <fen>Content</fen> or an <fen>Element</fen>  which fits into a religious belief system made up of many articles of faith. The <fen>Content</fen> is not necessarily tied to direct sensory experience. The system of beliefs may be enshrined by the members of a social group\n\n<ex>Do <fex name=\"Believer\">Muslims</fex> <t>believe</t> <fex name=\"el\">in the virgin birth of Jesus?</fex></ex>\n<ex><fex name=\"Believer\">Muslims</fex> <t>believe</t> <fex name=\"el\">in only One God, the same God that Jews and Christians believe in</fex>, but some of the ideas about the nature of God are different</ex>\n<ex><fex name=\"Believer\">Muslims</fex> <t>believe</t> <fex name=\"Content\">that the month of Ramadan is the holiest month of the year</fex></ex></def-root>', '2004-03-05 17:08:50', 'josef', '2004-03-05 18:33:18');
INSERT INTO Frame (ID, Name, Definition, CreatedDate, CreatedBy, ModifiedDate)VALUES (1145, 'Secrecy_status', '<def-root>A <fen>Phenomenon</fen>, which may be an activity, state or object, is purposefully hidden from the awareness of a potential <fen>Cognizer</fen>. The person responsible for the hiding of the <fen>Phenomenon</fen> is not part of this frame and cannot be syntactically realized. The potential <fen>Cognizer</fen> may be realized, but is in fact rarely expressed. A period of <fen>Time</fen> during which the <fen>Phenomenon</fen> is secret may be indicated.\n\n\n<ex>Few people would use ATMs if <fex name=\"phe\">the content of their transaction</fex> <m>was</m> <t>secret</t> <fex name=\"cog\">from their bank</fex> and there was no paper trail verifying the transaction. .</ex>\n\n<ex>The protesters were not on her list, and weren\t allowed in, despite the fact that <fex name=\"cog\">the meeting</fex> <m>was</m> <t>public</t>.</ex>\n\n<ex><fex name=\"phe\">Student disciplinary matters</fex> are <t>confidential</t> and should only be discussed with appropriate university officials</ex></def-root>', '2004-06-28 23:13:39', 'josef', '2004-06-29 12:23:58');
