INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (1, 'Cause', 'Cause', '<def-root>An animate or inanimate entity, a force, or event that produces an effect. Volitionality is not a necessary characteristic of <fen>Cause</fen>s.', 1, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (2, 'Affected', 'Affected', '<def-root>Agents in a joint or reciprocal action (e.g. exchange)</def-root>', 2, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (3, 'Effect', 'Effect', '<def-root>A positive or negative evaluation of the Phenomenon.<ex><fex name="Effect">低温でセルがかからないのは</fex>主に内部抵抗の上昇<t>より</t>ます。</ex></def-root>', 1, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (4, 'Communicator', 'Com', '<def-root>The person who uses language in the written or spoken modality to convey a Message to another person. <ex><fex name="Communicator">He</fex> finds it hard to <t>communicate</t> with people', 3, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (5, 'Addressee', 'Add', '<def-root>The <fen>Addressee</fen> receives a <fen>Message</fen> from the <fen>Communicator</fen>. ', 1, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (6, 'Message', 'Msg', '<def-root><fen>Message</fen> A proposition or set of propositions that the <fen>Communicator</fen> wants the', 5, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (7, 'Topic', 'Top', '<def-root>Topic is the entity that the proposition or propositions conveyed relate to, that they are about.', 1, 'Peripheral', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (8, 'Medium', 'Medium', '<def-root>The physical or abstract setting in which the Message is conveyed. ', 1, 'Peripheral', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (9, 'Theme', 'Thm', '<def-root>The <fen>Theme</fen> is the entity that changes location. Note that it is not a self-mover.',5 , 'Extra-Thematic', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (10, 'Source', 'Src', '<def-root>The <fen>Source</fen> is the location the <fen>Theme</fen> occupies initially before its change of location.', 2, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (11, 'Path', 'Path', '<def-root>The <fen>Path</fen> refers to (a part of) the ground over which the <fen>Theme</fen> travels  or to a landmark by which the <fen>Theme</fen> travels.', 2, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (12, 'Goal', 'Goal', '<def-root>The <fen>Goal</fen> is the location the <fen>Theme</fen> ends up in.', 1, 'Peripheral', 'N','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (13, 'Area', 'Area', '<def-root><fen>Area</fen> identifies the setting in which the <fen>Theme</fen>''s movement takes place without a specified <fen>Path</fen>.', 2, 'Peripheral', 'N','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (14, 'Perceiver', 'Perc', '<def-root>The FE <fen>Perceiver</fen> refers to someone whose cognitive state or experience (e.g. knowledge, beliefs, ideas judgments or classifications) is being described.</def-root>', 4, 'Peripheral', 'N','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (15, 'Phenomenon', 'Phen', '<def-root>An animate or inanimate entity, a force, or event that produces an effect. Volitionality is not a necessary characteristic of <fen>Cause</fen>s.', 4, 'Peripheral', 'N','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (16, 'Agent', 'Agt', '<def-root>Agent is the entity that acts on another entity.  </def-root>.', 5, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (17, 'Topic', 'Top', '<def-root>Topic is the entity that the proposition or propositions conveyed relate to, that they are about.', 8, 'Peripheral', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (18, 'Medium', 'Medium', '<def-root>The physical or abstract setting in which the Message is conveyed. ', 7, 'Peripheral', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (19, 'Theme', 'Thm', '<def-root>The <fen>Theme</fen> is the entity that changes location. Note that it is not a self-mover.',6 , 'Extra-Thematic', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (20, 'Source', 'Src', '<def-root>The <fen>Source</fen> is the location the <fen>Theme</fen> occupies initially before its change of location.', 7, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, Type, Core, CreatedDate, CreatedBy, ModifiedDate, SemRoleRank) VALUES (21, 'Path', 'Path', '<def-root>The <fen>Path</fen> refers to (a part of) the ground over which the <fen>Theme</fen> travels  or to a landmark by which the <fen>Theme</fen> travels.', 7, 'Core', 'Y','2005-11-03 03:21:56', 'shizuka', '2015-07-16 08:18:52',0);
