INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, SemRoleRank, Type, Core, CreatedBy) VALUES (3914, 'Speaker', 'Speaker','<def-root>The <fen>Speaker</fen> makes a prediction. <ex>The institute <t>forecast</t> an increase in leisure spending of 15 per cent.</ex></def-root>', 425, 0, 'Core', 'Y', 'josef');
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, SemRoleRank, Type, Core, CreatedBy) VALUES (3915, 'Eventuality', 'Eventuality','<def-root>This FE marks expressions that indicate an event or state that is predicted to occur or hold at a future time. A single <fen>Eventuality</fen> may be expressed discontinuously in a raising construction. This FE is also used for expressions that denote entities with variable attributes about which the <fen>Speaker</fen> makes predictions. <ex> <t> Predicting</t><fex name="Eventuality">the weather</fex> is risky business</ex> <ex><t>Predicting</t> <fex name="Eventuality">the numbers of disabled elderly</fex> into the future is problematic as it depends upon the projection forward of current patterns of disability .</ex> <ex> Wang<t>forecasts</t> <fex name="Eventuality">a 9 per cent increase in state revenue</fex></ex><ex> <fex name="Eventuality">The European market</fex> is  <t>forecast</t> <fex name="Eventuality">to grow 18.1%</fex>.</ex></def-root>', 425, 0, 'Core', 'Y', 'josef');
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, SemRoleRank, Type, Core, CreatedBy) VALUES (3916, 'Evidence', 'Evidence','<def-root>This Frame Element marks expressions that denote a set of facts on the basis of which the <fen>Speaker</fen> makes the prediction. <ex>Violence was  <t>predicted</t> <fex name="Evidence">on the basis of disorder at demonstrations in Paris</fex>.</ex></def-root>', 425, 0, 'Peripheral', 'Y', 'josef');
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, SemRoleRank, Type, Core, CreatedBy) VALUES (3923, 'Time', 'Time','<def-root>This FE identifies the <fen>Time</fen> when the prediction is made. <ex>John <t>predicted</t> <fex name="Time">last year</fex> that he would be finished by October.</ex></def-root>', 425, 0, 'Peripheral', 'N', 'josef');
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, SemRoleRank, Type, Core, CreatedBy) VALUES (3924, 'Place', 'Place','<def-root>The <fen>Place</fen> where the <fen>Speaker</fen> makes the prediction. <ex> Greenman <t>predicted</t> <fex name="Place">at a small dinner party</fex> that the market would rise again.</ex></def-root>', 425, 0, 'Peripheral', 'N', 'josef');
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, SemRoleRank, Type, Core, CreatedBy) VALUES (3946, 'Manner', 'Mnr','<def-root><fen>Manner</fen> marks any description of the <fen>Speaker</fen>''s prediction making  that is not covered by more specific FEs. <ex>Smeagol <fex name="Mnr">confidently</fex> <t>predicted</t> that he would win the race.</ex> <ex>One commentator <fex name="Manner">rashly</fex> <t>predicted</t> that the fad for adaptions wouldn''t last much longer</ex> Note that this FE does not cover modifiers such as ''correctly'' or ''accurately''.</def-root>', 425, 0, 'Peripheral', 'N', 'josef');
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, SemRoleRank, Type, Core, CreatedBy) VALUES (3947, 'Time_of_Eventuality', 'Time_of_Eventuality','<def-root>This frame element marks expressions that indicate forwhat future time an <fen>Eventuality</fen> is predicted. <ex> Cocoa stocks reached a record 1.2m tonnes and a seventh year of surplus is <t>forecast</t> <fex name="Time_of_Eventuality">for the year to September 1991</fex>.</ex></def-root>', 425, 0, 'Peripheral', 'Y', 'josef');
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, Frame_Ref, SemRoleRank, Type, Core, CreatedBy) VALUES (3950, 'Accuracy', 'Acc','<def-root>This FE indicates the <fen>Accuracy</fen> of the prediction. <ex>Compary president Randall Johnson <t>predicted</t> <fex name="Accuracy">correctly</fex> that a major reworking of infrastructure would be necessary.</ex> <ex>It is hard to <t>forecast</t> <fex name="Accuracy">with a high degree of certainty</fex> what the weather will be like past two or three days.</ex></def-root>', 425, 0, 'Peripheral', 'Y', 'josef');
INSERT INTO FrameElement (ID, Name, Abbrev, Definition, SemRoleRank, Type, Core, CreatedDate, CreatedBy, Frame_Ref, ModifiedDate)VALUES(83, 'Cognizer', 'Cog', '<def-root>The <fen>Cognizer</fen> is the person whose awareness of phenomena is at question. With a target verb or adjective the <fen>Cognizer</fen> is generally expressed as an External Argument with the <fen>Content</fen> expressed as an Object or Complement.\n<ex><fex name=\"Cognizer\">Your boss</fex> is <t>aware</t> of your commitment.</ex>\n<ex><fex name=\"Cognizer\">The students</fex> do not <t>know</t> the answer.</ex>\n<ex><fex name=\"Cognizer\">Pat</fex> <t>believes</t> that things will change for the better.</ex> </def-root>', 0, 'Core', 'Y', '2001-02-07 16:11:51', 'wooters', 19, '2003-04-24 15:52:33'),(84, 'Content', 'Cont', '<def-root>The <fen>Content</fen> is the object of the <fen>Cognizer</fen>\s awareness. <fen>Content</fen> can be expressed as a direct object or in a PP Complement.\n\n<ex>Your boss is <t>aware</t> <fex name=\"Content\">of your commitment</fex>.</ex>\n<ex>The students do not <t>know</t> <fex name=\"Content\">of your commitment</fex>.</ex>\n<ex>Pat <t>believes</t> <fex name=\"Content\">that things will change for the better</fex>.</ex> </def-root>', 0, 'Core', 'Y', '2001-02-07 16:11:52', 'wooters', 19, '2003-04-24 15:52:33'),(85, 'Evidence', 'Evid', '<def-root>The source of awareness or knowledge which can be expressed in a PP Complement:\n<ex>The sailors <t>knew</t> <fex name=\"Evid\">from the look of the sky</fex> that a storm was coming.</ex>\n<ex>I <t>knew</t> <fex name=\"Evid\">from experience</fex> that Jo would be late.</ex> </def-root>', 0, 'Peripheral', 'Y', '2001-02-07 16:11:52', 'wooters', 19, '2003-06-10 10:26:06'),(86, 'Topic', 'Top', '<def-root>Some verbs in this frame allow a <fen>Topic</fen> to be expressed in about-PPs.\n<ex>Kim <t>knows</t> <fex name=\"Topic\">about first aid</fex>.</ex> \nHowever, a number of nouns and adjectives in this frame which cannot take about-phrases allow <fen>Topic</fen> to be expressed as an adjectival or adverbial modifier.\n<ex>Kim is <fex name=\"Topic\">politically</fex> <t>aware</t>. </ex>\n<ex> <fex name=\"Topic\">Environmental</fex> <t>consicousness</t> is increasing.</ex> </def-root>', 0, 'Core', 'Y', '2001-02-07 16:11:52', 'wooters', 19, '2003-04-24 15:52:33'),(942, 'Degree', 'Degr', 'This FE identifies the Degree to which an event occurs.', 0, 'Peripheral', 'N', '2001-06-22 19:14:43', 'infinity', 19, '2003-04-24 15:53:00'), (946, 'Manner', 'Manr', 'This FE identifies the Manner in which the Cognizer knows or thinks something.', 0, 'Peripheral', 'N', '2001-06-22 19:14:43', 'infinity', 19, '2003-04-24 15:53:00'), (950, 'Expressor', 'Expr', '<def-root><fen>Expressor</fen> is the body part that reveals the <fen>Cognizer</fen>\s state to the observer.\n<ex>Bob\s <t>attentive</t> <fex name=\"Expressor\">eyes</fex> searched her face.</ex></def-root>', 0, 'Core', 'N', '2001-06-22 19:32:42', 'infinity', 19, '2003-06-10 10:26:06'),(951, 'Role', 'Role', '<def-root><fen>Role</fen> is the category within which an element of the <fen>Content</fen> is considered.\n<ex>He <t>understood</t> her remark <fex name=\"Role\">as an insult</fex>.</ex></def-root>', 0, 'Peripheral', 'N', '2001-06-22 19:35:40', 'infinity', 19, '2003-04-24 15:53:00'),(4549, 'Paradigm', '', '<def-root>This frame element identifies the <fen>Paradigm</fen>  which serves as the basis for the <fen>Cognizer</fen>\s awareness.\n<ex><fex name=\"Content\">The formation of black holes</fex> should be <t>understood</t> <fex name=\"Paradigm\">in astrophysic terms</fex>.</ex></def-root>', 0, 'Peripheral', 'N', '2003-06-06 15:41:17', 'fanyang', 19, '2004-07-30 17:35:45');
