INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (1, '北朝鮮 側 は 、 １ ９ ４ ５ 年 以前 の 徴用 で 日本 に 渡っ た まま 行方 不明 と なっ て いる 朝鮮 人 について 、 ０ ０ 年 ３月 に １ ０ ８ 人 の 名簿 を 提出 し 、 さらに 同年 ７月 に 追加 提出 し た １ ５ １ 人 を 加え た 計 ２ ５ ９ 人 の 安否 調査 を 引き続き 求める と み られる 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (2, '１ ４ 日 午後 １ 時 ごろ 、 鳥取 県 河原町 北村 の 三滝 渓谷 （ み たき けい こく ） の つり橋 （ 鉄骨 製 、 長 さ ４ １ ． ５ メートル 、 幅 １ ． ５ メートル ） を 渡っ て い た 同 県 米子 市 角盤 町 、 米国 人 英語 講師 、 エドワード ・ テイラー さん （ ３ ５ ） の 長男 拳 志郎 君 （ ３ ） が 、 つり橋 の 床板 の すき間 から 約 ４ ０ メートル 下 の 河原 に 転落', 1, 0, 0,0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (3, '知人 の 医師 の 話 に よる と 、 欧米 で は 、 横断 歩道 を 渡る とき の 信号 と 同様 、 緑 ・ 黄 ・ 赤 に 大別 し て 、 「 緑 」 は ゆっくり 診 て よく 、 「 黄 」 は 急い で 診る 。', 1,0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (4, '何 週間 も 奴隷 船 に 詰め込ま れ 大西洋 を 渡っ た 人々 の 中 に は 「 アフリカ に 戻れ た 」 と 錯覚 し た 人 も い た だろ う 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (5, '子ども は 横断 歩道 を 渡る 前 に 左右 を 確認 し ます が 、 横断 中 に は 左右 を 見 ない 。', 1,0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (6, '昭一 さん は 、 拉致 被害 者 の 支援 組織 「 救う 会 ・ 新潟 」 の 小島 晴 則 会長 （ ７ １ ） ら と 佐渡 に 渡り 、 真野 町 に ある 曽我 さん の 実家 を 訪ね た 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (7, '政府 調査 団 報告 に よる と 、 ジェン キン ス 氏 は 分隊 長 として 韓国 駐在 中 の ６ ５ 年 １月 、 北朝鮮 に 渡り 、 ８ ０ 年 ８月 に 曽我 さん と 結婚 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (8, '上海 越 劇 院 オーケストラ の 二 胡 奏者 として 活動 し て い た が 、 ９ １ 年 日本 に 渡る 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (9, 'ハンス は アメリカ に 渡る 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (10, '当時 の 交通 事情 を 考える と 、 大陸 に 渡る の は 大変 な 困難 だっ た でしょ う し 、 相当 の カルチャー ショック も 受け た と 思い ます 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (11, '大陸 に 渡っ て 初めて 独自 の 世界 観 、 自然 観 が 花開い た に 違い あり ませ ん 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (12, 'オランダ に 渡っ て 成長 し た 得点 へ の 姿勢 を 前面 に 押し出し た 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (13, '今 会談 で は 、 北朝鮮 に 渡っ た 日本人 配偶 者 の 里帰り 事業 再開 など も 話し合わ れ た が 、 日 朝 国交 交渉 の 打開 に つながる 本筋 の 問題 は 、 行方 不明 者 の 調査 で ある 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (14, '高校 卒業 後 、 秘書 など を 経 て 、 ２ ３ 歳 の とき ケニア に 渡り 、 人類 学者 ルイス ・ リー キー 博士 の もと で 働い た 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (15, '恵まれ ない 境遇 に 育ち 、 機会 を 得 て 植物 学者 の ベーツ と共に アマゾン に 渡り 、 熱帯 性 原生 林 を 見 て 啓示 を 受け た と 伝え られ て いる 。', 1,0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, Paragraph_Ref, AbsolutePos, ParagraphOrder, ExternalID, CreatedBy, CreatedDate, ModifiedDate) VALUES (16, '三 代目 の 三遊 亭 金 馬 は ６ ０ 歳 の 時 、 釣り に 出かけ 、 近道 しよ う と 鉄橋 を 渡り 、 列車 に ひか れ て 右足 先 を 切断 し た 。', 1, 0, 0, 0, 'test user', '2005-05-11 18:56:21','2005-05-11 18:56:21');
INSERT INTO Sentence (ID, Text, ParagraphOrder, AbsolutePos, CreatedDate, CreatedBy, Paragraph_Ref, ModifiedDate, ExternalID) VALUES (33066, 'ＯＥＣＤ （ 経済 開発 機構 。 ） が 、 現在 の 子ども が 大人 に なる 二 千 二 十 年 の 社会 を 予想 する 報告 を 行っ て い ます 。', 2, 0, '2008-10-21 18:27:29', 'sone', 1, '2008-10-21 18:27:29', 0);
INSERT INTO Sentence (ID, Text, ParagraphOrder, AbsolutePos, CreatedDate, CreatedBy, Paragraph_Ref, ModifiedDate, ExternalID) VALUES (33067, 'その 報告 に よる と 、 ＯＥＣＤ に 加盟 し て いる 先進 諸国 三 十 カ国 において は 、 製造 業 の 生産 高 は 二 倍 に なる が 、 製造 業 に 従事 する 労働 者 の 割合 は 多く て も 十 パーセント 、 少ない 国 で は 二 パーセント に まで 激減 する と 予想 し て い ます 。', 3, 0, '2008-10-21 18:27:29', 'sone', 1, '2008-10-21 18:27:30', 0);
INSERT INTO Sentence (ID, Text, ParagraphOrder, AbsolutePos, CreatedDate, CreatedBy, Paragraph_Ref, ModifiedDate, ExternalID) VALUES (29269, '６ ． １ 　 見え ない もの を 予想 する （ １ 。 ） 　 粒子 モデル 作り に かかわる 中学生 の 実態 　 科学 者 が モデル 作り を 行う の は 、 自然 事象 に 潜む 仕組み 、 すなわち 法則 や 原理 を ビジュアル な 形 で 示す こと に より 、 これら を 明瞭 に 示し 、 説明 する ため で ある 。', 0, 0, '2008-10-21 18:19:33', 'sone', 1, '2008-10-21 18:19:34', 0);
INSERT INTO Sentence (ID, Text, ParagraphOrder, AbsolutePos, CreatedDate, CreatedBy, Paragraph_Ref, ModifiedDate, ExternalID) VALUES (26636, '初期 の 予想 に 反し 、 実に 五 百 年 ぶり という 噴火 の 規模 で あっ た 。', 2, 0, '2008-10-21 18:14:25', 'sone', 1, '2008-10-21 18:14:25', 0);
INSERT INTO Sentence (ID, Text, ParagraphOrder, AbsolutePos, CreatedDate, CreatedBy, Paragraph_Ref, ModifiedDate, ExternalID) VALUES (83847, '初期 の 予想 に 反し 、 実 に ５００年ぶり という 噴火 の 規模 であっ た 。', 4, 0, '2015-08-17 10:30:56', 'bccwj2jfn', 1, '2015-08-17 10:30:56', 0);
INSERT INTO Sentence (ID, Text, ParagraphOrder, AbsolutePos, CreatedDate, CreatedBy, Paragraph_Ref, ModifiedDate, ExternalID)VALUES (84641, '姿勢 の 意味 が だんだん に 自分 に わかっ てくる 。', 5, 0, '2015-08-17 10:30:57', 'bccwj2jfn', 1, '2015-08-17 10:30:57', 0);
INSERT INTO Sentence (ID, Text, ParagraphOrder, AbsolutePos, CreatedDate, CreatedBy, Paragraph_Ref, ModifiedDate, ExternalID)VALUES (83095, '自分 で 入れ た のだ から 、 それ が なん な の か は 見 なく て も わかる 。', 5, 0, '2015-08-17 10:30:55', 'bccwj2jfn', 1, '2015-08-17 10:30:55', 0);
INSERT INTO Sentence (ID, Text, ParagraphOrder, AbsolutePos, CreatedDate, CreatedBy, Paragraph_Ref, ModifiedDate, ExternalID)VALUES(29625, '多く の 方 は 、 この 建物 を 見れ ば 少なくとも 坪 単価 七 十 万 円 以上 に は 見える と 思い ます 。', 4, 0, '2008-10-21 18:20:20', 'sone', 1, '2008-10-21 18:20:20', 0),(30330, 'エピソード ２ 南 仏 篇 　 その １ カーニバル 休暇 　 ２ 週間 の クリスマス 休暇 が 終わり 、 通常 の 生活 が 戻っ た と 思っ た とたん 、 さて ２月 の 最初 の ２ 週間 、 再び 学校 は お 休み に 入る 。', 0, 0, '2008-10-21 18:21:40', 'sone', 1, '2008-10-21 18:21:40', 0), (87250, '多く の 方 は 、 この 建物 を 見れ ば 少なくとも 坪単価 七〇万円以上 に は 見える と 思い ます 。', 6, 0, '2015-08-17 10:31:01', 'bccwj2jfn', 1, '2015-08-17 10:31:01', 0), (88079, '２週間 の クリスマス休暇 が 終わり 、 通常 の 生活 が 戻っ た と 思っ た とたん 、 さて ２月 の 最初 の ２週間 、 再び 学校 は お休み に 入る 。', 3, 0, '2015-08-17 10:31:03', 'bccwj2jfn', 1, '2015-08-17 10:31:03', 0),(88268, '露天風呂 の ある 旅館 に 泊まり 、 そんな もの の どこ が いい の か さっぱり わから ない けれど 、 露天風呂 や サウナ に おとうさん は 子供 の よう に 興奮し 、 時間 かかる と 思う から ハル は 好き な こと を し て たらいい 、 ゲームコーナー で ゲームし て てもいい し 、 部屋 で ずっと テレビ を 見 て てもいい 、 五百円玉 一つ わたし て そう 言い残し 、 浴衣姿 で うきうき と お風呂 に いっ てしまっ た 。', 1, 0, '2015-08-17 10:31:03', 'bccwj2jfn', 1, '2015-08-17 10:31:03', 0), (90117, '障子紙 の 担当 でない 方 に は 面白く ない か と 思う が 、 どの よう に 当初 の 商品構成 の 狙い を 検証し 、 どの よう に 陳列 を 調整し 在庫 の 持ち方 を 変え ていっ た か 、 実例 を 見 て 自分 の 仕事 に 置き換え て 参考 に し てほしい 。', 4, 0, '2015-08-17 10:31:06', 'bccwj2jfn', 1, '2015-08-17 10:31:06', 0), (91735, 'この 事件 に 関連し て 、 テレビ の 『 報道ステーション 』 に ゲスト出演し てい た 作家 の 村上龍さん が 、 「 もう 、 これこれ こう いう 理由 で 、 こんな 事件 が 起き まし た 、 と 説明でき ない 事件 が これ から 起こり得る と 思っ た ほう が いい 」 といった ニュアンス の コメント を し てい た 。', 2, 0, '2015-08-17 10:31:08', 'bccwj2jfn', 1, '2015-08-17 10:31:08', 0);
INSERT INTO Sentence (ID, Text, ParagraphOrder, AbsolutePos, CreatedDate, CreatedBy, Paragraph_Ref, ModifiedDate, ExternalID)VALUES (86455, 'よく できる 子どもたち は 、 この こと を よく 知っ ており 、 学業 に いそしむ 。', 4, 0, '2015-08-17 10:31:00', 'bccwj2jfn', 1, '2015-08-17 10:31:00',0), (90601, '尾張出身 の 人 なら ば 、 反対せ られ そう な もの と 気 を つけ ている が 、 まだ そう いう 話 も 耳 に し ない ので 、 単に 一説 として 自分 の 知っ ている こと だけ を 並べ てみる 。', 2, 0, '2015-08-17 10:31:06', 'bccwj2jfn', 1, '2015-08-17 10:31:06', 0), (90736, '長い まつ毛 を 通し て 鋭い 目 が 光っ てい た が 、 しかし 彼 は とき に 応じ 、 その 烈しい 眼光 を 消す こと も 知っ てい た 。', 9, 0, '2015-08-17 10:31:07', 'bccwj2jfn', 1, '2015-08-17 10:31:07', 0),(90876, '東洋 の 門人たち は 、 師 の 願い を 知っ てい て 、 その 年 の 初冬 に 京都 の 治安 を つかさどる 所司代 に 解剖 を 申し出 た 。', 5, 0, '2015-08-17 10:31:07', 'bccwj2jfn', 1, '2015-08-17 10:31:07',0);
